#define NUM_THREADS 6

struct Flock flock = Flock();

void printFlock(struct Flock pFlock) {
	std::cout << "TODOS LOS PAJAROS" << std::endl;
	int printIndex;
	for (printIndex = 0; printIndex < NUM_BIRDS; printIndex++) {
		std::cout << "id: " << std::to_string(pFlock.birds[printIndex].id)
				  << " distance: " << std::to_string(pFlock.birds[printIndex].distance)
				  << " maxSpeed: " << std::to_string(pFlock.birds[printIndex].maxSpeed)
				  << " minSpeed: " << std::to_string(pFlock.birds[printIndex].minSpeed)
		<< std::endl;
	}

	pFlock.topFurthestDistance.print();
	pFlock.topShortestDistance.print();
	pFlock.topFastest.print();
	pFlock.topSlowest.print();
}

void updateRanking(Rank* pRank, double pValue, int pId)
{
	if (pRank->name == "furthest" || pRank->name == "fastest")
		pRank->updateMax(pId,pValue);
	else if (pRank->name == "shortest" || pRank->name == "slowest")
		pRank->updateMin(pId,pValue);
}

void mergeBirdData(Bird* pBird1, Bird* pBird2)
{
	pBird1->id = pBird2->id;
	pBird1->distance += pBird2->distance;
	if (pBird1->maxSpeed < pBird2->maxSpeed)
		pBird1->maxSpeed = pBird2->maxSpeed;
	if (pBird1->minSpeed > pBird2->minSpeed)
		pBird1->minSpeed = pBird2->minSpeed;
}

void merge(Flock *f1, Flock *f2)
{
	// Se van uniendo los calculos parciales
	int mergeIndex;
	#pragma omp parallel for
	for (mergeIndex = 0; mergeIndex < NUM_BIRDS; mergeIndex++){
		if (f2->birds[mergeIndex].id != -1)	// Hay threads que a veces no tocan ciertos pajaros por lo que el id viene con -1, esos no los debe actualizar
		{
			mergeBirdData(&f1->birds[mergeIndex], &f2->birds[mergeIndex]);

			updateRanking(&f1->topFurthestDistance, f1->birds[mergeIndex].distance, f1->birds[mergeIndex].id);
			updateRanking(&f1->topFastest, f1->birds[mergeIndex].maxSpeed, f1->birds[mergeIndex].id);
			updateRanking(&f1->topSlowest, f1->birds[mergeIndex].minSpeed, f1->birds[mergeIndex].id);
		}
	}
}

void updateBird(Bird* pBird, int pId, double pDistance, double pSpeed)
{
	pBird->id = pId;
	pBird->distance += pDistance;
	if (pBird->maxSpeed < pSpeed)
		pBird->maxSpeed = pSpeed;
	if (pBird->minSpeed > pSpeed)
		pBird->minSpeed = pSpeed;
}

void updateMinDistance(Flock * pFlock) {
	for (int mergeIndex = 0; mergeIndex < NUM_BIRDS; mergeIndex++) {
		updateRanking(&pFlock->topShortestDistance, pFlock->birds[mergeIndex].distance, pFlock->birds[mergeIndex].id);
	}
}

