{	
	std::cout << "COPIE Y PEGUE LA SIGUENTE ESTRUCTURA EN EL CODIGO JAVASCRIPT:" << std::endl;
	std::cout << "Al inicio del archivo bird.js" << std::endl;
	std::cout << std::endl;
	std::cout << "var ranking = {" <<
			 	 "\n\tmaslargo1 : " << std::to_string(pFlock->topFurthestDistance.values[0]) << "," <<
				 "\n\tmaslargo2 : " << std::to_string(pFlock->topFurthestDistance.values[1]) << "," <<
				 "\n\tmascorto1 : " << std::to_string(pFlock->topShortestDistance.values[0]) << "," << 
				 "\n\tmascorto2 : " << std::to_string(pFlock->topShortestDistance.values[1]) << "," <<
				 "\n\tmasrapida1 : " << std::to_string(pFlock->topFastest.values[0]) << "," << 
				 "\n\tmasrapida2 : " << std::to_string(pFlock->topFastest.values[1])<< "," <<
				 "\n\tmaslenta1 : " << std::to_string(pFlock->topSlowest.values[0]) << "," << 
				 "\n\tmaslenta2 : " << std::to_string(pFlock->topSlowest.values[1]) << "\n}" << std::endl;
			
}

